import { exec as exec2 } from "child_process";
import { promisify as promisify6 } from "util";
var execAsync2 = promisify6(exec2);
async function detectPort() {
  const sleep = (ms) => new Promise((resolve) => setTimeout(resolve, ms));
  const maxAttempts = 5;
  for (let attempt = 1;attempt <= maxAttempts; attempt++) {
    try {
      const { stdout: pidOutput } = await execAsync2(`lsof -n | grep '${process.cwd()}' | grep node | awk '{print $2}' | uniq`);
      const pids = pidOutput.trim().split(`
`);
      if (pids.length === 0) {
        console.log(`Attempt ${attempt}/${maxAttempts}: No Node.js processes found running in the current directory.`);
        if (attempt < maxAttempts) {
          await sleep(1000);
          continue;
        }
        return null;
      }
      const { stdout: portOutput } = await execAsync2("lsof -n -i -P | grep LISTEN | grep node");
      const portLines = portOutput.trim().split(`
`);
      const ports = portLines.filter((line) => pids.some((pid) => line.includes(pid))).map((line) => {
        const match = line.match(/:(\d+)/);
        return match?.[1] ? parseInt(match[1], 10) : null;
      }).filter((port) => port !== null);
      if (ports.length === 0) {
        console.log(`Attempt ${attempt}/${maxAttempts}: No ports found for Node.js processes in the current directory.`);
        if (attempt < maxAttempts) {
          await sleep(1000);
          continue;
        }
        return null;
      }
      if (ports.length > 1) {
        console.log(`Multiple ports found: ${ports.join(", ")}. Using the first one.`);
      }
      return ports[0] ?? null;
    } catch (error) {
      try {
        const { stdout } = await execAsync2("netstat -ano | findstr :LISTENING | findstr node.exe");
        const match = stdout.match(/:(\d+)/);
        if (match && match[1]) {
          return parseInt(match[1], 10);
        }
      } catch (winError) {
        console.error(`Attempt ${attempt}/${maxAttempts}: Error detecting port:`, winError);
        if (attempt < maxAttempts) {
          await sleep(1000);
          continue;
        }
      }
    }
  }
  return null;
}

